import { TAG } from '../../types';

const KeysTransform = {
  labels: TAG.LABEL,
  insertions: TAG.INSERTION,
  connections: TAG.CONNECTION,
  labels_qa: TAG.LABEL_QA,
};
export default KeysTransform;
